import React from "react";

import Layout from "../components/Layout";

const Home = () => {
  return (
    <React.Fragment>
      <Layout>
        <main>
          <h1>Find a beach cleanup near you!</h1>
        </main>
      </Layout>

      <style jsx>{`
        main {
          height: calc(100vh - 55px);
        }
      `}</style>
    </React.Fragment>
  );
};

export default Home;
